import { useEffect, useState } from "react";
import { Diagnosis, Entry } from "../types";
import patientService from "../services/patients";
import { useParams } from "react-router-dom";


const PatientEntries: React.FC<{ entries: Entry[] }> = ({ entries }: {entries: Entry[]} ) => {
    const id = useParams().id?.toString() || null;

    const [diagnoses, setDiagnoses] = useState<Diagnosis[] | null>(null)


    useEffect(() => {
        const fetchDiagnoses = async () => {
            const fetchedDiagnoses = await patientService.getDiagnoses(id)
            setDiagnoses(fetchedDiagnoses)
        }
        fetchDiagnoses()
    }, [diagnoses, id])


    function assertNever(value: never): never {
        throw new Error(`Unhandled value: ${value}`);
      }

      return (
        <>
          {entries.map((entry) => {
            switch (entry.type) {
              case "Hospital":
                return (
                  <div key={entry.id}>
                    {entry.date} {entry.description}
                    <br />
                    {entry.diagnosisCodes?.map((diagnose) => (
                      <li key={diagnose}>
                        {diagnose}{" "}
                        {diagnoses?.find(
                          (it) =>
                            it.code.toLowerCase() === diagnose.toLowerCase()
                        )?.name}
                      </li>
                    ))}
                  </div>
                );
              case "OccupationalHealthcare":
                return (
                  <div key={entry.id}>
                    {entry.date} {entry.description}
                    <br />
                    {entry.diagnosisCodes?.map((diagnose) => (
                      <li key={diagnose}>
                        {diagnose}{" "}
                        {diagnoses?.find(
                          (it) =>
                            it.code.toLowerCase() === diagnose.toLowerCase()
                        )?.name}
                      </li>
                    ))}
                  </div>
                );
              case "HealthCheck":
                return (
                  <div key={entry.id}>
                    {entry.date} {entry.description}
                    <br />
                    {entry.diagnosisCodes?.map((diagnose) => (
                      <li key={diagnose}>
                        {diagnose}{" "}
                        {diagnoses?.find(
                          (it) =>
                            it.code.toLowerCase() === diagnose.toLowerCase()
                        )?.name}
                      </li>
                    ))}
                  </div>
                );
              default:
                return assertNever(entry);
            }
          })}
        </>
      );
    };

    export default PatientEntries;
